import React from "react";

const Message = ({ Children }) => {
  return (
    <div class="alert alert-dismissible alert-warning">
      <h4 class="alert-heading">Warning!</h4>
      <p class="mb-0">{Children}</p>
    </div>
  );
};

export default Message;
